import { SET_HORARIO } from "./types";

export function setHorario(horario) {
  //Set de la obraSocial que quiero editar
  return (dispatch) => {
    dispatch({
      type: SET_HORARIO,
      payload: horario,
    });
  };
}

export function getHorario(horario) {
  return (dispatch) => {
    fetch("http://localhost:8080/configuracionTurnos/1", {
      method: "GET",
      headers: { "Content-Type": "application/json" },
    })
      .then((response) => response.json())
      .then((data) =>
        dispatch({
          type: SET_HORARIO,
          payload: data,
        })
      );
  };
}
